import axios from 'axios'



class Main extends Component {



    constructor(props) {
        super(props)

        this.state = {
             arr:[

             ]
        }
    }

    componentDidMount(){
        axios.get('http://saral.navgurukul.org/api/courses')
        .then(posRes=>{
            const data = posRes.data
            console.log("possss",data)
            this.setState({data});
        })
        .catch(errRes=>{
            console.log(errRes)
            console.log('errRes')

        })
    }


    render() {
        console.log("ressssss",this.state.arr)
        console.log("ksjdfk")

        return (
            <div>
                <table border='1' align="center">
                    <thead>
                        <tr>

                        </tr>
                        <th> id</th>
                        <th> name</th>
                        <th>type</th>
                        <th>logo</th>
                        <th>short_description</th>
                    </thead>
                </table>
                <tbody>
                    {this.state.arr.map((element,index)=>(

                        <tr>
                            <td>{element.id}</td>
                            <td> {element.name} </td>
                            <td>{element.type} </td>
                            <td><img src={element.logo}></img></td>
                            <td>{element.short_description}</td>
                        </tr>

                    ))}
                </tbody>


            </div>
        )
    }
}
 export default Main;
